import React, { useState } from 'react';
import './book.css';

const BookingForm = () => {




    const handleSubmit = (e) => {
        e.preventDefault();


    };

    return (
        <div className="booking-container">
            <h2>Book your Service</h2>
            <form onSubmit={handleSubmit} className="booking-form">o
                <input type="text" required name="name" placeholder="Your Name" required nChange={handleChange} />
                <input type="email" required name="email" placeholder="Your Email" required onChange={handleChange} />
                <select name="service" required onChange={handleChange}>
                    <option value="">Select a Service</option>
                    <option value="cleaning">engine diagnostics</option>
                    <option value="plumbing">oil and filters</option>
                    <option value="electrician">brake repair</option>
                    <option value="electrician">wheel alignment</option>
                    <option value="electrician">general service</option>
                    <option value="electrician">bettry checking</option>
                </select>
                <input type="date" name="date" required onChange={handleChange} />
                <input type="time" name="time" required onChange={handleChange} />
                <textarea name="message" placeholder="Additional Notes" onChange={handleChange}></textarea>
                <button type="submit">Submit Booking</button>
            </form>
        </div>
    );
};

export default BookingForm;
